import React from "react";
import styled from "styled-components";
import CreateIcon from "@mui/icons-material/Create";

//styling our component
const Wrapper = styled.div``;

export default function ComposeButton() {
  return (
    <Wrapper>
      <ButtonWrapper>
        <CreateIcon />
        <p>Compose</p>
      </ButtonWrapper>
    </Wrapper>
  );
}
